import React from 'react';
import { Box, Typography, Card, CardContent, CardActionArea } from '@mui/material';
import { styled } from '@mui/material/styles';
import { useHistory } from 'react-router-dom';
import PsychologyIcon from '@mui/icons-material/Psychology';
import PeopleIcon from '@mui/icons-material/People';
import ChildCareIcon from '@mui/icons-material/ChildCare';

interface Service {
  title: string;
  description: string;
  icon: React.ReactNode;
  path: string;
}

interface ServiceCardProps {
  service: Service;
  onClick: () => void;
}

const ServicesContainer = styled(Box)(({ theme }) => ({
  padding: '80px 20px',
  backgroundColor: 'white',
}));

const StyledCard = styled(Card)(({ theme }) => ({
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  transition: 'all 0.3s ease-in-out',
  '&:hover': {
    transform: 'translateY(-5px)',
    boxShadow: theme.shadows[4],
    backgroundColor: theme.palette.grey[50],
  },
}));

const DebugActionArea = styled(CardActionArea)(({ theme }) => ({
  border: '2px solid red', // DEBUG: remove after test
  cursor: 'pointer',
  height: '100%',
  display: 'flex',
  flexDirection: 'column',
  justifyContent: 'stretch',
}));

const IconWrapper = styled(Box)(({ theme }) => ({
  display: 'flex',
  justifyContent: 'center',
  padding: theme.spacing(3),
  '& svg': {
    fontSize: '64px',
    color: theme.palette.primary.main,
  },
}));

const ServiceCard: React.FC<ServiceCardProps> = ({ service, onClick }) => (
  <StyledCard elevation={2}>
    <DebugActionArea onClick={onClick}>
      <IconWrapper>
        {service.icon}
      </IconWrapper>
      <CardContent>
        <Typography gutterBottom variant="h5" component="h2" align="center">
          {service.title}
        </Typography>
        <Typography variant="body2" color="text.secondary" align="center">
          {service.description}
        </Typography>
      </CardContent>
    </DebugActionArea>
  </StyledCard>
);

const Services: React.FC = () => {
  const history = useHistory();

  const services: Service[] = [
    {
      title: 'Terapia Individual',
      description: 'Atendimento personalizado para adultos, focando em suas necessidades específicas e objetivos terapêuticos.',
      icon: <PsychologyIcon />,
      path: '/terapia-individual',
    },
    {
      title: 'Terapia para Jovens',
      description: 'Acompanhamento especializado para adolescentes e jovens adultos, abordando questões específicas desta fase da vida.',
      icon: <PeopleIcon />,
      path: '/terapia-jovens',
    },
    {
      title: 'Psicologia Infantil',
      description: 'Atendimento especializado para crianças, utilizando técnicas lúdicas e abordagens apropriadas para cada faixa etária.',
      icon: <ChildCareIcon />,
      path: '/psicologia-infantil',
    },
  ];

  const handleServiceClick = (path: string) => {
    console.log('CARD CLICKED! Navigating to:', path);
    history.push(path);
  };

  return (
    <ServicesContainer id="services">
      <Typography variant="h3" component="h2" align="center" gutterBottom sx={{ color: '#1B5E20', mb: 6 }}>
        Nossos Serviços
      </Typography>
      <Typography variant="h6" align="center" color="text.secondary" paragraph>
        Oferecemos diferentes modalidades de atendimento para atender às suas necessidades
      </Typography>
      <Box sx={{ 
        display: 'flex', 
        flexWrap: 'wrap', 
        gap: 4, 
        justifyContent: 'center',
        mt: 2
      }}>
        {services.map((service) => (
          <Box 
            key={service.title} 
            sx={{ 
              flex: { 
                xs: '1 1 100%', 
                sm: '1 1 calc(50% - 16px)', 
                md: '1 1 calc(33.333% - 22px)' 
              },
              maxWidth: { 
                xs: '100%', 
                sm: 'calc(50% - 16px)', 
                md: 'calc(33.333% - 22px)' 
              }
            }}
          >
            <ServiceCard
              service={service}
              onClick={() => handleServiceClick(service.path)}
            />
          </Box>
        ))}
      </Box>
    </ServicesContainer>
  );
};

export default Services;
